{
    "name": "santigarcor/laratrust",
    "description": "This package provides a flexible way to add Role-based Permissions to Laravel",
    "keywords": [
        "acl",
        "authorization",
        "laravel",
        "laratrust",
        "permissions",
        "php",
        "rbac",
        "roles",
        "multiusers",
        "teams"
    ],
    "license": "MIT",
    "authors": [
        {
            "name": "Santiago Garcia",
            "homepage": "http://santigarcor.me"
        }
    ],
    "require": {
        "php": ">=8.1",
        "kkszymanowski/traitor": "^1.0",
        "laravel/framework": "^10.0|^11.0"
    },
    "require-dev": {
        "mockery/mockery": "^1.3.2",
        "orchestra/testbench": "^8.0|^9.0",
        "phpunit/phpunit": "^8.4|^9.0|^10.5"
    },
    "autoload": {
        "psr-4": {
            "Laratrust\\": "src/"
        }
    },
    "autoload-dev": {
        "psr-4": {
            "Laratrust\\Tests\\": "tests/"
        }
    },
    "config": {
        "sort-packages": true
    },
    "prefer-stable": true,
    "minimum-stability": "dev",
    "extra": {
        "laravel": {
            "providers": [
                "Laratrust\\LaratrustServiceProvider"
            ],
            "aliases": {
                "Laratrust": "Laratrust\\LaratrustFacade"
            }
        }
    }
}

